    false,nt"url": null,nt"notes": "This annual narrative report for Don Edwards
    San Francisco Bay NWR, Antioch Dunes NWR, Farallon NWR, San Pablo Bay NWR, Ellicot
    Slough NWR, Salinas River NWR, and Marin Islands NWR outlines Refuge accomplishments
    during the 2000 calendar year. The report begins with a summary of the year's highlights
    and weather conditions. Land acquisition is covered. The report includes a planning
    section which discusses public participation, compliance with environmental and
    cultural resource mandates, and research and investigations. Refuge administration
    is outlined; information about personnel, youth programs, manpower programs, volunteer
    programs, funding, safety, and technical assistance is given. Habitat management
    is also covered; subjects include wetlands, forests, fire management, pest control,
    and water rights. The wildlife section of the report discusses wildlife diversity,
    endangered and threatened species, waterfowl, shorebirds, raptors, game mammals,
    marine mammals, fisheries resources, animal control, marking and bird banding, and
    disease control. The public uses of the Refuge described in this report include
    outdoor classrooms, interpretive programs, hunting, fishing, trapping, wildlife
    observation, outdoor recreation, and law enforcement. The equipment and facilities
    section of the report provides information about new construction, rehabilitation,
    major maintenance, equipment replacement, communication systems, computer systems,
    and energy conservation. Cooperative programs, economic uses of the Refuge, and
    items of interest are provided at the end.",nt"license_title": "License Not
